import React, { useState } from 'react';
import { Menu, X } from 'lucide-react';

const NavLink = ({ to, children, setIsOpen }) => (
    <a 
        href={`#${to}`} 
        onClick={() => setIsOpen && setIsOpen(false)} // Close menu on mobile click
        className="text-gray-700 hover:text-[#D4A74B] transition duration-200 block py-2 lg:py-0 lg:inline-block"
    >
        {children}
    </a>
);

// Renamed toggleView to handleNavigation for clarity
const Navbar = ({ handleNavigation, currentView }) => {
    const [isOpen, setIsOpen] = useState(false);

    // Determines if we are in the main public/scrolling view
    const isPublicScrollingView = currentView === 'public';

    return (
        <header className="sticky top-0 z-50 bg-white shadow-md">
            <div className="container mx-auto px-4 sm:px-6 lg:px-8 py-3 flex justify-between items-center">
                {/* Logo - Navigates to home (public view) */}
                <button 
                    onClick={() => handleNavigation('public')}
                    className="text-2xl font-bold text-[#1F3B66] hover:text-[#D4A74B] transition duration-300 focus:outline-none"
                >
                    ARM <span className="text-[#D4A74B]">Group</span>
                </button>

                {/* Desktop Navigation & Toggle Button */}
                <nav className="hidden lg:flex items-center space-x-8">
                    {/* Navigation Links for the main Public View (scroll links) */}
                    {isPublicScrollingView && (
                        <>
                            <NavLink to="hero">Home</NavLink>
                            <NavLink to="about">About Us</NavLink>
                            <NavLink to="services">Services</NavLink>
                            {/* NEW: Navigation to the separate Company Profile view */}
                            <button
                                onClick={() => handleNavigation('profile')}
                                className="text-gray-700 hover:text-[#D4A74B] transition duration-200"
                            >
                                Company Profile
                            </button>
                            <NavLink to="footer">Contact</NavLink>
                        </>
                    )}
                    
                    {/* Link for Profile View to go back to Home */}
                    {currentView === 'profile' && (
                        <button
                            onClick={() => handleNavigation('public')}
                            className="text-gray-700 hover:text-[#D4A74B] transition duration-200"
                        >
                            Back to Home
                        </button>
                    )}

                    {/* Admin Toggle Button */}
                    <button 
                        onClick={() => handleNavigation(currentView === 'admin' ? 'public' : 'admin')}
                        className="px-4 py-2 bg-[#1F3B66] text-white text-sm font-semibold rounded-md shadow-md hover:bg-[#D4A74B] hover:text-[#1F3B66] transition duration-300"
                    >
                        {currentView === 'admin' ? 'Back to Site' : 'Admin Login'}
                    </button>
                </nav>

                {/* Mobile Menu Button */}
                <div className="lg:hidden">
                    <button onClick={() => setIsOpen(!isOpen)} className="text-[#1F3B66] focus:outline-none">
                        {isOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
                    </button>
                </div>
            </div>

            {/* Mobile Menu Dropdown */}
            {isOpen && (
                <div className="lg:hidden fixed inset-0 backdrop-blur-sm px-4 pt-2 pb-4 space-y-2 bg-white border-t">
                    {/* Links for Public Scrolling View */}
                    {isPublicScrollingView && (
                        <>
                            <NavLink to="hero" setIsOpen={setIsOpen}>Home</NavLink>
                            <NavLink to="about" setIsOpen={setIsOpen}>About Us</NavLink>
                            <NavLink to="services" setIsOpen={setIsOpen}>Services</NavLink>
                            {/* NEW Mobile Link */}
                            <button
                                onClick={() => { handleNavigation('profile'); setIsOpen(false); }}
                                className="w-full text-left px-4 py-2 text-gray-700 hover:text-[#D4A74B] transition duration-200"
                            >
                                Company Profile
                            </button>
                            <NavLink to="footer" setIsOpen={setIsOpen}>Contact</NavLink>
                        </>
                    )}
                    
                    {/* Link for Profile View to go back to Home */}
                    {currentView === 'profile' && (
                        <button
                            onClick={() => { handleNavigation('public'); setIsOpen(false); }}
                            className="w-full text-left px-4 py-2 text-gray-700 hover:text-[#D4A74B] transition duration-200"
                        >
                            Back to Home
                        </button>
                    )}

                    {/* Admin/Public Toggle Button */}
                    <button 
                        // Now using handleNavigation directly
                        onClick={() => { handleNavigation(currentView === 'admin' ? 'public' : 'admin'); setIsOpen(false); }}
                        className="w-full text-left px-4 py-2 bg-[#1F3B66] text-white text-sm font-semibold rounded-md shadow-md hover:bg-[#D4A74B] hover:text-[#1F3B66] transition duration-300 mt-2"
                    >
                        {currentView === 'admin' ? 'Back to Site' : 'Admin Login'}
                    </button>
                </div>
            )}
        </header>
    );
};

export default Navbar;
